import * as React from "react";
import {
  Text,
  View,
  StyleSheet,
  Image,
  Pressable,
  TouchableOpacity,
} from "react-native";

export default function (props) {
  return (
    <View style={{ backgroundColor: "white", width: "100%", height: "100%" }}>
      <Image
        source={{
          uri: "https://flowhub.imgix.net/inventory-illustration.gif",
        }}
        style={{
          width: "100%",
          height: "350px",
          position: "absolute",
          marginTop: 100,
        }}
      />
      <View style={{ margin: 10 }}>
        <Image
          source={{
            uri: "https://www.millenniumprecision.com/wp-content/uploads/2017/02/inventory.png",
          }}
          style={{ height: 50, position: "relative" }}
        />
      </View>
      <TouchableOpacity onPress={() => props.navigation.navigate("Reg")}>
        <View style={styles.container}>
          <View style={styles.topContainer}>
            <View style={styles.metaContainer}>
              <View>
                <Text style={styles.description}>Хэрхэн бараа бүртгэх вэ?</Text>
              </View>
            </View>
            <Image
              source={{
                uri: "https://icon-library.com/images/inventory-icon/inventory-icon-8.jpg",
              }}
              style={styles.avatar}
            />
          </View>
        </View>
      </TouchableOpacity>
      <TouchableOpacity onPress={() => props.navigation.navigate("Contact")}>
        <View style={styles.container1}>
          <View style={styles.topContainer}>
            <View style={styles.metaContainer}>
              <View>
                <Text style={styles.description}>Бидний тухай</Text>
              </View>
            </View>
            <Image
              source={{
                uri: "https://www.freeiconspng.com/uploads/contacts-icon--26.png",
              }}
              style={styles.avatar}
            />
          </View>
        </View>
      </TouchableOpacity>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    marginTop: "300px",
    marginBottom: 20,
    backgroundColor: "#40E0D0",
    paddingVertical: 10,
    paddingHorizontal: 12,
    borderRadius: 10,
    borderWidth: 3,
    alignSelf: "center",
    width: 375,
    maxWidth: "90%",
    opacity: 0.9,
  },
  container1: {
    margin: 20,
    backgroundColor: "#00FF00",
    paddingVertical: 15,
    paddingHorizontal: 12,
    borderRadius: 10,
    borderWidth: 3,
    alignSelf: "center",
    width: 370,
    maxWidth: "90%",
    opacity: 0.9,
  },
  timings: {
    color: "#fff",
    fontSize: "14px",
  },
  metaContainer: {
    justifyContent: "space-between",
  },
  topContainer: {
    flexDirection: "row",
    justifyContent: "space-between",
  },
  avatar: {
    height: 100,
    width: 100,
    borderRadius: 10,
    opacity: 1,
  },
  description: {
    color: "white",
    marginTop: 5,
    fontSize: 20,
  },
  button: {
    backgroundColor: "#22d3ee",
    alignSelf: "flex-start",
    paddingHorizontal: 12,
    paddingVertical: 4,
    borderRadius: 2,
  },
  buttonText: {
    fontWeight: "bold",
    color: "white",
    textTransform: "uppercase",
    fontSize: 14,
  },
});
